contract structure
{
    struct Book {
        string title ;
        string author;
        int bookId;
        int price;
    }
Book book;

function setBook() public 
{
book=Book("Blockchain","Avinash Singh",100,23);

}
function disBook() public view returns(string memory,string memory ,int,int)
{
return (book.title,book.author,book.bookId,book.price);
}
}
